INSERT INTO `post` (`id`, `estado`, `id_usuario`, `tipo`, `comida`, `nombre`, `autor`, `ingredientes`, `contenido`, `img`, `video`) VALUES
(2, 'Puebla', 1, 'R', 'Platillo', 'Chiles en nogada', 'Alejandra Manzano', '<ul><li>300 Gramos Carne de res</li><li>1/2 Cucharadita Clavos de olor molidos</li><li>300 Gramos Carne de cerdo enlatada molida</li><li>1/4 Taza Pasas</li><li>1/4 Taza Perejil fresco picado</li><li>1 Pieza Manzana gala lavada, pelada, descorazonada y cortada en cubos</li><li>1 Lata Leche Evaporada</li><li>1 1/2 Taza Nuez castilla, pelada</li></ul>', '<div>Para el relleno, licua los jitomates, la cebolla en polvo, la canela molida, el clavo molido y el agua.</div><div><br /></div><div>En una cacerola calienta el aceite, frie la carne de cerdo y res, agrega sal cocina por 10 minutos o hasta que este cocida, vierte lo que licuaste y cocina por 5 minutos mas, agrega el durazno, la manzana, las pasas y las almendras mezcla hasta integrar, retira del fuego y reserva.</div><div><br /></div><div>Para la nogada, licua la Media Crema&nbsp; con el azucar, el queso crema, el consome de pollo, la nuez de castilla y la Leche Evaporada , llevar al fuego y dejar reducir.</div><div><br /></div>Rellena cada chile con el relleno, calienta en microondas por 1 minuto, con la salsa en nogada y decora con la granada y el perejil. Ofrece.<br />Para que la salsa en nogada tenga mejor sabor y aroma se recomienda freir con mantequilla, dejar a que hierva por 10 min a fuego medio.', , 'https://www.youtube.com/embed/d1FhnH6_NfE?start=43');
INSERT INTO `post` (`id`, `estado`, `id_usuario`, `tipo`, `comida`, `nombre`, `autor`, `ingredientes`, `contenido`, `img`, `video`) VALUES
(3, 'Aguascalientes', 1, 'R', 'Platillo', 'Enchiladas Rojas ', 'Esteban Ruiz', '<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 2.5rem; max-width: 100%; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><li style=\"box-sizing: border-box;\">Queso Oaxaca - 250 gramos</li><li style=\"box-sizing: border-box;\">Tortillas de maíz - 12 piezas</li><li style=\"box-sizing: border-box;\">Aceite vegetal - 1 taza</li><li style=\"box-sizing: border-box;\">Chiles guajillos secos - 5 piezas</li><li style=\"box-sizing: border-box;\">Chiles anchos secos - 3 piezas</li><li style=\"box-sizing: border-box;\">Jitomate rojo - 1 pieza</li><li style=\"box-sizing: border-box;\">Ajo - 4 dientes</li></ul>', '<ol><li><span style=\"font-family: Roboto, sans-serif;\">Comenzamos precalentando el horno a 180Â° C. Mientras a los chiles los desvenamos y quitamos los tallo y semillas.</span></li><li><span style=\"font-family: Roboto, sans-serif;\">Posteriormente, continuamos preparando la salsa roja de nuestras enchiladas, para ello en una olla o cacerola colocamos las 2 tazas de agua, los chiles, el jitomate, la cebolla, el ajo y sal al gusto. Dejamos cocer a fuego medio alto durante unos minutos, hasta que los chiles estan blanditos.</span></li><li><span style=\"font-family: Roboto, sans-serif;\">Al mismo tiempo que dejamos cociendo los chiles, picamos finamente la cebolla para servir, asi como el perejil. Deshebramos el queso que vamos a utilizar para rellenar las enchiladas.</span></li></ol>', , 'https://www.youtube.com/embed/vfTD3cWpLbM?start=43');
