(4, 'Oaxaca', 1, 'B', 'Platillo', '¿Queso Oaxaca o quesillo?', 'Diana Hdz', NULL, '<p style=\"justify\">Como ya se habrán dado cuenta, he usado estos dos terminos de forma indistinta. <br> ¡Y es que el queso Oaxaca y el quesillo son lo mismo! Cuentan por ahi que este queso obtuvo el nombre de Oaxaca en el vecino estado de Puebla, para designarlo como un producto proveniente de ese otro estado. Aunque no hay una regla estricta, podemos decir que, de manera general, el queso Oaxaca se conoce así en todos lados menos en el estado que lo vio nacer supongo que para evitar redundancias.\r\n\r\nEs curioso que la palabra quesillo se llega a utilizar fuera de Oaxaca, aunque en contextos muy especificos. Un buen ejemplo son los puestos de tortas de la Ciudad, donde el queso y el quesillo aparecen como dos ingredientes independientes en el menu. Chilango que se respeta sabe que el quesillo hace referencia al queso Oaxaca mientras que el queso puede ser panela o amarillo.\r\n</p>', , 'https://www.youtube.com/embed/l_uWtkDT6Ac?start=7');
