(5, 'Coahuila', 1, 'B', 'Postre', 'Origen del piloncillo', 'Gael Lpz', NULL, '<div>Los conquistadores trajeron a México los trapiches o molinos para elaborar este producto. Al hervir el jugo de la caña de azúcar se obtiene la melaza que se solidifica en moldes o envuelta en palmas. <br /></div><div><br /></div><div>También forma parte de diversas gastronomías de Latinoamérica y algunas de Asia.Los conquistadores trajeron a México los trapiches o molinos para elaborar este producto. Al hervir el jugo de la caña de azúcar se obtiene la melaza que se solidifica en moldes o envuelta en palmas.</div><div> <br /></div><div>También forma parte de diversas gastronomías  y algunas de Asia.</div>', , 'https://www.youtube.com/embed/2_PgmDJO0S0?start=10');

